import React from 'react';

const SearchBox = ( {searchChange} ) => {
    return (
        <div className='pa2'>
            <input
                className='pa3 bg-transparent ba b--dotted bw1' 
                type='search' 
                placeholder='search robots' 
                onChange={searchChange} 
            />
        </div>
    );
}

export default SearchBox;
